import React, { useEffect, useState } from 'react';
import Table from 'react-bootstrap/Table'
import stockXLogo from '../images/stockx.png'
import goatLogo from '../images/goat.png'
import flightClubLogo from '../images/flightclub.png'
import stadiumGoodsLogo from '../images/stadiumgoods.png'

const PriceTable = (props) =>{
    const sizes = new Set();
    var cols = () =>{
        for(var size in props.sneaker.resellPrices.stockx){
            sizes.add(size);
        }
        for(var size in props.sneaker.resellPrices.flightClub){
            sizes.add(size);
        }
        for(var size in props.sneaker.resellPrices.goat){
            sizes.add(size);
        }
        for(var size in props.sneaker.resellPrices.stadiumGoods){
            sizes.add(size);
        }
        console.log(sizes)
        let shoeSizes = Array.from(sizes).sort(function(a, b){return a-b;});
        console.log(shoeSizes)
    }
    cols();



    return(
<div class='table-card'>
    <Table  responsive  >
    <thead >
        <tr>
        <th>US Size</th>
        {Array.from({ length: 25 }).map((_, index) => (
            <th key={index}> {index} </th>
        ))}
        </tr>
    </thead>
    <tbody>
        <tr>
        <td><img src={stockXLogo}></img></td>
        {Array.from({ length: 12 }).map((_, index) => (
            <td key={index}> $10{index}</td>
        ))}
        </tr>
        <tr>
        <td><img src={flightClubLogo}></img></td>
        {Array.from({ length: 12 }).map((_, index) => (
            <td key={index}>$10{index}</td>
        ))}
        </tr>
        <tr>
        <td class='goat-row'><img src={goatLogo}></img></td>
        {Array.from({ length: 12 }).map((_, index) => (
            <td key={index}> $10{index}</td>
        ))}
        </tr>
        <tr>
        <td><img src={stadiumGoodsLogo}></img></td>
        {Array.from({ length: 12 }).map((_, index) => (
            <td key={index}> $10{index}</td>
        ))}
        </tr>
    </tbody>
    </Table>
    </div>


    )

}




export default PriceTable
